import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Routes,
    Route,
    useRoutes,
     Link } from "react-router-dom";
import IntroPage from './components/IntroPage/IntroPage'
import QuestionsPage from "./components/QuestionsPage/QuestionsPage";
import DatePage from "./components/DatePage/DatePage";
import CompletionPage from "./components/CompletionPage/CompletionPage";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import PageHeader from './components/PageHeader/PageHeader';
import PageFooter from './components/PageFooter/PageFooter';

function App() {

  const components = [
    {path:"/", name:"IntroPage", componentClass: IntroPage},
    {path:"/QuestionsPage", name:"QuestionsPage", componentClass: QuestionsPage},
    {path:"/DatePage", name:"DatePage", componentClass: DatePage},
    {path:"/CompletionPage", name:"CompletionPage", componentClass: CompletionPage}
  ];


  return (
    <Router>
      <Container className='containerHeight'>
        <PageHeader components={components}/>
      </Container>
      <Container className='containerHeight'>
        <Row>
          <Col>
          </Col>
          <Col xs={12}>
            <Routes>
              <Route exact path='/' element={<IntroPage/>} />
              <Route path='/questions' element={<QuestionsPage/>} />
              <Route path='/date' element={<DatePage/>} />
              <Route path='/completion' element={<CompletionPage/>} />
            </Routes>
          </Col>
          <Col>
          </Col>
        </Row>
      </Container>
      <Container>
        <PageFooter pageCount="5" index="2"/>
      </Container>
    </Router>
  );
}

export default App;
